import {
  createBrowserRouter,
  RouterProvider,

} from "react-router-dom"
import './App.css';

const router= createBrowserRouter([
  {
    path:"/",
    element:<span>Home</span>
  },
  {
    path:"/products/:id",
    element:<span>Category</span>
  },
  {
    path:"/product/:id",
    element:<span>product</span>
  },
])
function App() {
  return (
    <div className="App">
 <RouterProvider router={router}/>
    </div>
  );
}

export default App;
